    true,nt"url": null,nt"notes": "The Private School Universe Survey, 2009-10
    (PSS 2009-10), is a study that is part of the Private School Universe Survey program.
    PSS 2009-10 (http://nces.ed.gov/surveys/pss/) is a cross-sectional survey that builds
    an accurate and complete universe of private schools to serve as a sampling frame
    for NCES surveys of private schools and generates biennial data on the total number
    of private schools, teachers, and students. The study was conducted using surveys
    of administrative personnel. A universe of private schools extant in October 2009
    was built. The studyufffds response rate was 93.6 percent. Key statistics produced
    from PSS 2009-10 are religious orientation, level of school, length of school year,
    length of year and school day, total enrollment (K-12), race/ethnicity of students,
    number of high school graduates, number of teachers employed, program emphasis,
    and existence and type of kindergarten program.",nt"license_title": "Creative
